define('text!views/funds/browse.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">REQUESTS</h4>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <a data-bind="click: navigateToCreateView">Create a new fund</a>\r\n            </div>\r\n        </div>\r\n\r\n        <p class="error" data-bind="if: error, text: error"></p>\r\n\r\n        <div class="row">\r\n            <div class="large-4 columns">\r\n                <label for="Area">\r\n                    Requesting area\r\n                </label>\r\n                <select name="Area" data-bind="foreach: areas, value: selectedAreaId">\r\n                    <option data-bind="attr: { value: Id }, text: Name"></option>\r\n                </select>\r\n            </div>\r\n        </div>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <table class="tabular" data-bind="visible: !noItemsToShow()">\r\n                    <thead>\r\n                        <tr>\r\n                            <th>Fund number</th>\r\n                            <th>Fund title</th>\r\n                            <th>Responsible person</th>\r\n                            <th class="hide-for-medium-down">Current fiscal year approved budget</th>\r\n                            <th class="hide-for-medium-down">YTD and projected expenditures through June 30</th>\r\n                            <th class="hide-for-medium-down">Requested budget</th>\r\n                            <th class="hide-for-medium-down">Variance</th>\r\n                            <th class="hide-for-medium-down">Status</th>\r\n                        </tr>\r\n                    </thead>\r\n                    <tbody data-bind="foreach: items">\r\n                        <tr>\r\n                            <td>\r\n                                <a data-bind="fastlink: \'#/funds/edit/\' + Id, text: Number"></a>\r\n                            </td>\r\n                            <td data-bind="text: Title"></td>\r\n                            <td data-bind="text: ResponsiblePerson"></td>\r\n                            <td class="hide-for-medium-down currency" data-bind="text: CurrentBudget"></td>\r\n                            <td class="hide-for-medium-down currency" data-bind="text: ProjectedExpenditures"></td>\r\n                            <td class="hide-for-medium-down currency" data-bind="text: requestedBudget"></td>\r\n                            <td class="hide-for-medium-down currency" data-bind="text: variance"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: fundStatusText"></td>\r\n                        </tr>\r\n                    </tbody>\r\n                </table>\r\n            </div>\r\n        </div>\r\n\r\n        <p data-bind="if: noItemsToShow">No records</p>\r\n    </div>\r\n</div>\r\n';});

