define('text!views/reports/funding-request.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">FUNDING REQUEST REPORT</h4>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <p>\r\n                    <a href="http://foundationportal.cloudapp.net/reportfile/fundingrequest">Download Excel version</a>\r\n                </p>\r\n            </div>\r\n        </div>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <table class="tabular">\r\n                    <thead>\r\n                        <tr>\r\n                            <th>Fund number</th>\r\n                            <th>Fund title</th>\r\n                            <th>Responsible person</th>\r\n                            <th>Current fiscal year approved budget</th>\r\n                            <th>YTD and projected expenditures through June 30</th>\r\n                            <th>Requested budget</th>\r\n                            <th>Variance</th>\r\n                        </tr>\r\n                    </thead>\r\n                    <!-- ko foreach: items -->\r\n                    <tbody>\r\n                        <tr>\r\n                            <td colspan="7" class="text-center" data-bind="text: Name"></td>\r\n                        </tr>\r\n                        <!-- ko foreach: funds -->\r\n                        <tr>\r\n                            <td data-bind="text: Number"></td>\r\n                            <td data-bind="text: Title"></td>\r\n                            <td data-bind="text: ResponsiblePerson"></td>\r\n                            <td class="currency" data-bind="text: CurrentBudget"></td>\r\n                            <td class="currency" data-bind="text: ProjectedExpenditures"></td>\r\n                            <td class="currency" data-bind="text: requestedBudget"></td>\r\n                            <td class="currency" data-bind="text: variance"></td>\r\n                        </tr>\r\n                        <!--/ko-->\r\n                    </tbody>\r\n                    <tbody>\r\n                        <tr class="subtotal" data-bind="with: subtotals">\r\n                            <td colspan="3" data-bind="text: \'Total for \' + $parent.Name()"></td>\r\n                            <td class="currency" data-bind="text: currentBudget"></td>\r\n                            <td class="currency" data-bind="text: projectedExpenditures"></td>\r\n                            <td class="currency" data-bind="text: requestedBudget"></td>\r\n                            <td class="currency" data-bind="text: variance"></td>\r\n                        </tr>\r\n                    </tbody>\r\n                    <!--/ko-->\r\n                    <tbody>\r\n                        <tr class="grandtotal" data-bind="with: grandTotals">\r\n                            <td colspan="3">Grand totals</td>\r\n                            <td class="currency" data-bind="text: currentBudget"></td>\r\n                            <td class="currency" data-bind="text: projectedExpenditures"></td>\r\n                            <td class="currency" data-bind="text: requestedBudget"></td>\r\n                            <td class="currency" data-bind="text: variance"></td>\r\n                        </tr>\r\n                    </tbody>\r\n                </table>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n';});

define('text!views/reports/narrative-information.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">NARRATIVE INFORMATION REPORT</h4>\r\n\r\n        <table>\r\n            <thead>\r\n                <tr>\r\n                    <th>Fund number</th>\r\n                    <th>Fund description</th>\r\n                    <th>Reason for increase/decrease</th>\r\n                    <th>Projected increase/decrease</th>\r\n                </tr>\r\n            </thead>\r\n            <!-- ko foreach: items -->\r\n            <tbody>\r\n                <tr>\r\n                    <td colspan="7" class="text-center" data-bind="text: Name"></td>\r\n                </tr>\r\n                <!-- ko foreach: funds -->\r\n                <tr>\r\n                    <td data-bind="text: Number"></td>\r\n                    <td data-bind="text: Description"></td>\r\n                    <td data-bind="text: BudgetAdjustmentNote"></td>\r\n                    <td data-bind="text: BudgetAdjustment"></td>\r\n                </tr>\r\n                <!--/ko-->\r\n            </tbody>\r\n            <!--/ko-->\r\n        </table>\r\n    </div>\r\n</div>';});

define('text!views/shared/_area-input.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <section data-bind="with: item">\r\n            <h4 class="view-heading">AREA INFORMATION</h4>\r\n\r\n            <fieldset>\r\n                <h5>Details</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label for="Number">\r\n                            Number<span class="required">*</span>\r\n                        </label>\r\n                        <input name="Number" type="text" data-bind="value: Number" />\r\n                        <label for="Number"\r\n                            class="error-message" data-bind="validationMessage: Number"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <label for="Name">\r\n                            Name<span class="required">*</span>\r\n                        </label>\r\n                        <input name="Name" type="text" data-bind="value: Name" />\r\n                        <label for="Name"\r\n                            class="error-message" data-bind="validationMessage: Name"></label>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <div class="row">\r\n                <div class="large-12 columns">\r\n                    <span class="text-button" data-bind="click: $parent.saveItem">\r\n                        Save\r\n                    </span>\r\n                </div>\r\n            </div>\r\n        </section>\r\n    </div>\r\n</div>';});

define('text!views/shared/_fund-input.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <section data-bind="with: item">\r\n            <h4 class="view-heading">FUND INFORMATION</h4>\r\n\r\n            <fieldset>\r\n                <h5>Current status</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label for="Status">\r\n                            Status\r\n                        </label>\r\n                        <select name="Status" data-bind="value: Status">\r\n                            <option value="1">Draft</option>\r\n                            <option value="2">Final</option>\r\n                        </select>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label for="Number">\r\n                            Fund number<span class="required">*</span>\r\n                        </label>\r\n                        <input name="Number" type="text" data-bind="value: Number, css: { validationElement: true }" />\r\n                        <label for="Number" class="error-message" data-bind="validationMessage: Number"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-8 columns">\r\n                        <label for="Title">\r\n                            Fund title<span class="required">*</span>\r\n                        </label>\r\n                        <input name="Title" type="text" data-bind="value: Title" />\r\n                        <label for="Title" class="error-message" data-bind="validationMessage: Title"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <label for="ResponsiblePerson">\r\n                            Responsible person<span class="required">*</span>\r\n                        </label>\r\n                        <input name="ResponsiblePerson" type="text" data-bind="value: ResponsiblePerson" />\r\n                        <label for="ResponsiblePerson"\r\n                            class="error-message" data-bind="validationMessage: ResponsiblePerson"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <label for="CurrentBudget">\r\n                            Current fiscal year approved budget<span class="required">*</span>\r\n                        </label>\r\n                        <input name="CurrentBudget" type="text" data-bind="value: CurrentBudget" />\r\n                        <label for="CurrentBudget"\r\n                            class="error-message" data-bind="validationMessage: CurrentBudget"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <label for="ProjectedExpenditures">\r\n                            YTD and projected expenditures through June 30<span class="required">*</span>\r\n                        </label>\r\n                        <input name="ProjectedExpenditures" type="text" data-bind="value: ProjectedExpenditures" />\r\n                        <label for="ProjectedExpenditures"\r\n                            class="error-message" data-bind="validationMessage: ProjectedExpenditures"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <div class="input-panel">\r\n                            <span>Projected year-end balance :\r\n                            <strong \r\n                                data-bind="text: projectedYearEndBalance() >= 0 ? \'$\'\r\n                                    + projectedYearEndBalance() :\r\n                                    \'($\' + projectedYearEndBalance().toString().replace(/[^\\.\\d]/g, \'\') + \')\'"></strong>\r\n                            </span>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <fieldset>\r\n                <h5>Next year projected budget</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label for="BudgetAdjustment">\r\n                            Projected increase or decrease<span class="required">*</span>\r\n                        </label>\r\n                        <input name="BudgetAdjustment" type="text" data-bind="value: BudgetAdjustment" />\r\n                        <label for="BudgetAdjustment"\r\n                            class="error-message" data-bind="validationMessage: BudgetAdjustment"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <div class="input-panel">\r\n                            <span>Requested budget: \r\n                            <strong \r\n                                data-bind="text: requestedBudget() >= 0 ? \'$\'\r\n                                    + requestedBudget() :\r\n                                    \'($\' + requestedBudget().toString().replace(/[^\\.\\d]/g, \'\') + \')\'"></strong>\r\n                            </span>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <fieldset>\r\n                <h5>Supporting information</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-12 columns">\r\n                        <label for="Description">\r\n                            Brief description of the program and types of expenses paid for by this fund<span class="required">*</span>\r\n                        </label>\r\n                        <textarea name="Description" data-bind="value: Description"></textarea>\r\n                        <label for="Description"\r\n                            class="error-message" data-bind="validationMessage: Description"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-12 columns">\r\n                        <label for="BudgetAdjustmentNote">\r\n                            Reason for increase or decrease in the requested budget<span class="required"\r\n                            data-bind="visible: BudgetAdjustment() > 0">*</span>\r\n                        </label>\r\n                        <textarea name="BudgetAdjustmentNote" data-bind="value: BudgetAdjustmentNote"></textarea>\r\n                        <label for="BudgetAdjustmentNote"\r\n                            class="error-message" data-bind="validationMessage: BudgetAdjustmentNote"></label>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <fieldset>\r\n                <h5>Attachments</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-12 columns">\r\n                        <p>\r\n                            <a href="http://www.obfp.vt.edu/forms/foundation-portal/budget-request-template.xlsx">Download budget request template</a>\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n\r\n                <form name="fileInputForm">\r\n                    <input type="file" name="files[]" multiple\r\n                        data-bind="event: { onload: window.fileInputForm.reset(), change: $parent.postFiles }" />\r\n                </form>\r\n\r\n                <div class="row">\r\n                    <div class="large-12 columns">\r\n                        <table data-bind="visible: FileUploads().length > 0">\r\n                            <thead>\r\n                                <tr>\r\n                                    <th>File</th>\r\n                                    <th></th>\r\n                                </tr>\r\n                            </thead>\r\n                            <tbody data-bind="foreach: FileUploads">\r\n                                <tr data-bind="visible: !destroy()">\r\n                                    <td>\r\n                                        <a data-bind="visible: Id, text: OriginalFileName,\r\n    attr: { href: Source }"></a>\r\n                                        <span class="error-message"\r\n                                            data-bind="visible: errorMessage, text: errorMessage"></span>\r\n                                    </td>\r\n                                    <td data-bind="click: $root.removeFileUpload">\r\n                                        <i class="fi-trash"></i>\r\n                                    </td>\r\n                                </tr>\r\n                            </tbody>\r\n                        </table>\r\n\r\n                        <p data-bind="visible: FileUploads().length === 0">No files uploaded</p>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <div class="row" data-bind="visible: errorMessage">\r\n                <div class="large-12 columns">\r\n                    <p>\r\n                        <span class="error-message"\r\n                            data-bind="text: errorMessage"></span>\r\n                    </p>\r\n                </div>\r\n            </div>\r\n\r\n            <div class="row">\r\n                <div class="large-12 columns">\r\n                    <span class="text-button" data-bind="click: $parent.saveItem">Save\r\n                    </span>\r\n                </div>\r\n            </div>\r\n        </section>\r\n\r\n    </div>\r\n</div>\r\n';});

define('text!views/shell.html',[],function () { return '<div class="row view-background">\r\n    <div class="large-12 columns">\r\n        <h1 class="app-heading">foundation<span>portal</span></h1>\r\n\r\n        <section id="content" data-bind="router: { transition: \'scrollers\', cacheViews: true }">\r\n        </section>\r\n    </div>\r\n</div>';});

